import React from "react";

class Documents extends React.Component{
    constructor(){
        super();
        this.state={};
    }

    render(){
        return(
            <div id="docs-container">
                <div id="docs">
                    <div id="title">
                        <p>Documents</p>
                    </div>
                    <div id="file-info">
                        <p>Title</p>
                        <p>Author</p>
                        <p>Last Modified</p>
                    </div>
                    <div id="files">
                    </div>
                </div>
            </div>
        );
    }
}

export default Documents;
